import React from "react";
import {
  Nav,
  Navbar,
  NavDropdown,
  Form,
  FormControl,
  Button,
} from "react-bootstrap";
import "./App.css";

function App() {
  return (
    <Navbar bg="light" expand="lg">
      <div>
        <Navbar.Brand href="#home">
          <img
            src="/logo.png"
            width="100"
            height="100"
            className="d-inline-block align-top"
            alt="React Bootstrap logo"
          />
        </Navbar.Brand>
      </div>
      <Button/> 


    </Navbar>
  );
}

export default App;
